import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import ReportForm from './components/ReportForm';
import ComplaintForm from './components/ComplaintForm';
import ReportsList from './components/ReportsList';
import ComplaintsList from './components/ComplaintsList';
import UserManagement from './components/UserManagement';
import './styles/App.css';

function App() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const token = localStorage.getItem('token');
    const userData = localStorage.getItem('user');
    if (token && userData) {
      setUser(JSON.parse(userData));
    }
    setLoading(false);
  }, []);

  const login = (userData, token) => {
    localStorage.setItem('token', token);
    localStorage.setItem('user', JSON.stringify(userData));
    setUser(userData);
  };

  const logout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setUser(null);
  };

  if (loading) {
    return <div className="loading">Loading LUCT Reporting System...</div>;
  }

  return (
    <Router>
      <div className="app">
        <header className="app-header">
          <div className="header-content">
            <div className="logo-placeholder">
              <div className="logo">LUCT LOGO</div>
            </div>
            <h1>LUCT Reporting System</h1>
            {user && (
              <div className="user-info">
                <span>Welcome, {user.name} ({user.role.toUpperCase()})</span>
                <button onClick={logout} className="logout-btn">Logout</button>
              </div>
            )}
          </div>
        </header>

        <main className="app-main">
          <Routes>
            <Route 
              path="/login" 
              element={!user ? <Login onLogin={login} /> : <Navigate to="/dashboard" />} 
            />
            <Route 
              path="/register" 
              element={!user ? <Register onRegister={login} /> : <Navigate to="/dashboard" />} 
            />
            <Route 
              path="/dashboard" 
              element={user ? <Dashboard user={user} /> : <Navigate to="/login" />} 
            />
            <Route 
              path="/reports/new" 
              element={user ? <ReportForm user={user} /> : <Navigate to="/login" />} 
            />
            <Route 
              path="/reports" 
              element={user ? <ReportsList user={user} /> : <Navigate to="/login" />} 
            />
            <Route 
              path="/complaints/new" 
              element={user ? <ComplaintForm user={user} /> : <Navigate to="/login" />} 
            />
            <Route 
              path="/complaints" 
              element={user ? <ComplaintsList user={user} /> : <Navigate to="/login" />} 
            />
            <Route 
              path="/manage-users" 
              element={user && user.role === 'pl' ? <UserManagement user={user} /> : <Navigate to="/dashboard" />} 
            />
            <Route 
              path="/" 
              element={<Navigate to={user ? "/dashboard" : "/login"} />} 
            />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
